'''
   (binary search) leetcode: 875. Koko Eating Bananas (medium)

   Koko loves to eat bananas. There are `n` piles of bananas, the `ith` pile has `piles[i]` bananas. The guards have gone and will come back in `h` hours.

   Koko can decide her bananas-per-hour eating speed of `k`. Each hour, she chooses some pile of bananas and eats `k` bananas from that pile. If the pile has less than `k` bananas, she eats all of them instead and will not eat any more bananas during this hour.

   Koko likes to eat slowly but still wants to finish eating all the bananas before the guards return.

   Return the minimum integer `k` such that she can eat all the bananas within `h` hours.

   

   Example 1:
      Input: piles = [3,6,7,11], h = 8
      Output: 4

   Example 2:
      Input: piles = [30,11,23,4,20], h = 5
      Output: 30

   Example 3:
      Input: piles = [30,11,23,4,20], h = 6
      Output: 23
   

   Constraints:
      - 1 <= piles.length <= 10^4
      - piles.length <= h <= 10^9
      - 1 <= piles[i] <= 10^9

   Related Topics 
      (Array) (Binary Search)

   ========================================================= 

   Solution by myself: 
   
   LeetCode submission: 
      runtime: 651 ms, beats 5.28%
      memory: 17.9 MB, beats 46.58%
'''
import math
def minEatingSpeed(piles, h):
   piles.sort()
   # find l,m,r
   # [3,6,7,11]
   pl = len(piles)
   d = h // pl


   l = math.ceil( (piles[0] * pl) / h)
   r = piles[pl-1]
   print('INITIAL', 'l', l, 'r', r)
   if len(piles) == 1 or piles[0] == piles[pl-1]: 
      return math.ceil(piles[0] / d)
   m = (l + r) // 2 if (l + r) // 2 > 0 else 1


   def findM(l, r, m):
      while l != r:
         print('m', m)
         t = 0 
         isBreak = False
         for i in range(len(piles) -1, -1, -1):
            n = piles[i]
            t += math.ceil(n / m)
            if t + i > h:
               print('break too much', t, i, 'm', m)
               l = m + 1
               isBreak = True
               m = (l + r) // 2
               t += i
               break

         if isBreak: continue
            
         if (not isBreak) and t <= h:
            print('break too to few', t, i, 'm', m)
            r = m
            # if t == h: 
            #    m = l
            #    continue

         
         m = (l+r) // 2

      print('t', t, 'last m', m, 'l', l, 'r', r, )
      return (m, t)
   [m, t] = findM(l, r, m)
   print('at last', m, 't',  t)
   return m

   # print('l', l, 'r', r)

   # found, decrement!
   
